### ImageData.py ###
# contains data for images that pyautogui can recognize stored as strings
# containts functions for converting these strings to images as well as locating and selecting images
# turn off word wrap to get rid of mass wall of text 

import base64
import pyautogui
from PIL import Image
import io

# Helper function to convert strings to image data

def convertToImage(string):
    decoded_string = io.BytesIO(base64.b64decode(string))
    img = Image.open(decoded_string)
    return img

# Helper function for locating an item on the screen
def locate(image):
    if pyautogui.locateCenterOnScreen(image, confidence = 0.7) == None:
        return 0
    else:
        return 1
    
# Helper function for clicking an item on the screen
def click(image):
    if pyautogui.locateCenterOnScreen(image, confidence = 0.7) == None:
        return 0 
    else: 
        x,y = pyautogui.locateCenterOnScreen(image, confidence = 0.7)
        pyautogui.click(x,y) 
        return 1


